import sys

def toDecimal(num):
    stringedNum = str(num)
    i = len(stringedNum) - 1
    binaryList = []
    while i >= 0:
        binaryList.append(int(stringedNum[i]) * 2**(len(stringedNum)-i-1))
        i -= 1
    return sum(binaryList)

def splitInput(num):
    myList = []
    stringedNum = str(num)
    i = 0
    if len(stringedNum) % 7 == 0:
        while i < len(stringedNum):
            temp = stringedNum[i:i+7]
            myList.append(temp)
            i+=7
    elif len(stringedNum) % 8 == 0:
        while i < len(stringedNum):
            temp = stringedNum[i:i+8]
            myList.append(temp)
            i+=8
    return myList

def finalString(text):
    m = splitInput(text)
    myString = ""
    for num in m:
        myString = myString + chr(toDecimal(num))
    return(myString)

